	add("busful", "{\"term\":\"busful\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|bus|ful|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An amount sufficient to fill a bus\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1965\u0027\u0027, Thomas Pynchon, \u0027The Crying of Lot 49\u0027, The Penguin Press (2012), ISBN 9781101594605, [http://books.google.com/books?id\u003dIVDEZ4v6eG0C\u0026amp;pg\u003dPT57\u0026amp;dq\u003d%22busful%22 unnumbered page\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Riding among an exhausted \u0027\u0027busful\u0027\u0027 of Negroes going on to graveyard shifts all over the city\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Ronald Vaughan Morris, \u0027History and Imagination: Reenactments for Elementary Social Studies\u0027, Rowman \u0026amp; Littlefield (2012), ISBN 9781610482974, [http://books.google.com/books?id\u003d7J2oZCk7FbcC\u0026amp;pg\u003dPA1\u0026amp;dq\u003d%22busful%2\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22busful%22\u0026amp;f\u003dfalse page 1\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"I had a \u0027\u0027busful\u0027\u0027 of fifth-grade students expecting a field trip\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, Serge Quadruppani, \u0027The Sudden Disappearance of Worker Bees\u0027, Arcade Publishing (2013; original French novel published 2011), ISBN 9781611458404, [http://books.google.com/books?id\u003dQf0mAgAAQBAJ\u0026amp;pg\u003dPT54\u0026amp;dq\u003d%22busful%22 unnumbered page\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Due to the arrival of a \u0027\u0027busful\u0027\u0027 of Bavarian tourists, the noise in the hotel lobby was deafening\", \"priority\":8}]}, \"synonyms\":{}}");

