	add("bushel", "{\"term\":\"bushel\", \"etymology\":{\"influencers\":[], \"languages\":[\"Breton\", \"English\", \"old french (842-ca. 1400)\", \"old irish (to 900)\"], \"text\":\"From Old french (842-ca. 1400) {{m|fro|boissel}}, from {{m|fro|boisse}}, a grain measure based on Gaulish {{m|cel-gau|*bostyā‎||handful}}, from Proto-celtic {{m|cel-pro|*bostā||palm, fist}} (compare Breton {{m|br|boz||hollow of the hand}}, Old irish (to 900) {{m|sga|bas}}), from Proto-indo-european {{m|ine-pro|*gwost-}}, {{m|ine-pro|*gwosdʰ-||branch}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A dry measure, containing four pecks, eight gallons (36.4 L), or thirty-two quarts\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The Winchester bushel, formerly used in England, contained 2150.42 cubic inches, being the volume of a cylinder 181/2 inches in internal diameter and eight inches in depth. The standard bushel measures, prepared by the United States Government and distributed to the States, hold each 77.6274 pounds of distilled water, at 39.8° Fahr. and 30 inches atmospheric pressure, being the equivalent of the Winchester bushel. The imperial bushel now in use in England is larger than the Winchester bushel, containing 2218.2 cubic inches, or 80 pounds of water at 62° Fahr\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1882\u0027\u0027, James Edwin Thorold Rogers, \u0027A History of Agriculture and Prices in England\u0027, Volume 4, p. 207\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The quarter, bushel, and peck are nearly universal measures of corn\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A vessel of the capacity of a bushel, used in measuring; a bushel measure\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1526\u0027\u0027, William Tyndale, trans. \u0027Bible\u0027, Mark IV\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"And he sayde unto them: is the candle lighted, to be put under a \u0027\u0027busshell\u0027\u0027, or under the borde: ys it not therfore lighted that it shulde be put on a candelsticke\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A quantity that fills a bushel measure; as, a heap containing ten bushels of apples\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"In the United States a large number of articles, bought and sold by the bushel, are measured by weighing, the number of pounds that make a bushel being determined by State law or by local custom. For some articles, as apples, potatoes, etc., heaped measure is required in measuring a bushel\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A large indefinite quantity\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The iron lining in the nave of a wheel. [Eng.] In the United States it is called a box\", \"priority\":11}]}, \"synonyms\":{}}");

