	add("bushido", "{\"term\":\"bushido\", \"etymology\":{\"influencers\":[], \"languages\":[\"mandarin chinese\", \"English\", \"Japanese\", \"late middle chinese\"], \"text\":\"From Japanese \u0027sc\u003djpan\u0027 from Late middle chinese 武士 (\u0027mjú-dʐí\u0027 \u0026quot;warrior\u0026quot;) (compare Mandarin chinese \u0027wǔshì\u0027 武士, Cantonese \u0027mou\u0026lt;sup\u0026gt;5\u0026lt;/sup\u0026gt;-si\u0026lt;sup\u0026gt;6\u0026lt;/sup\u0026gt;\u0027 武士) + 道 (\u0027dáu\u0027 \u0026quot;way\u0026quot;).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An ethical code of the samurai that was prevalent in feudal Japan that advocated unquestioning loyalty to the master at all costs and obedience in all deeds, valuing honor above life\", \"priority\":1}]}, \"synonyms\":{}}");

