	add("bushwalking", "{\"term\":\"bushwalking\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The activity of hiking or backpacking\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, Drew Hutton, Libby Connors, \u0027A History of the Australian Environment Movement\u0027, [http://books.google.com.au/books?id\u003ddlsbib7EN4AC\u0026amp;pg\u003dPA70\u0026amp;dq\u003d%22bushwalking%22+-intitle:%22bushwalking%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dPFIbT7uOJs-QiQesh73ZCw\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22bushwalking%22%20-intitle%3A%22bushwalking%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 70\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Eight years later she married a fellow member, Leo Luckman, and the two of them played leading roles in the Tasmanian \u0027\u0027bushwalking\u0027\u0027 movement, exploring the most remote parts of the state, developing new routes through difficult terrain, pioneering the club′s skiing activities, and shouldering executive responsibilities\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Chris Rowthorn, Alex Landragin, Kate Daly, \u0027Victoria\u0027, [http://books.google.com.au/books?id\u003dqs8z_d-a7McC\u0026amp;pg\u003dPA77\u0026amp;dq\u003d%22bushwalking%22+-intitle:%22bushwalking%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d51QbT9jeA6muiAekv7WEDA\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22bushwalking%22%20-intitle%3A%22bushwalking%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 77\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Victoria has some great \u0027\u0027bushwalking\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Susannah Farfor, David Andrew, Hugh Finlay, \u0027Northern Territory\u0027, [http://books.google.com.au/books?id\u003dTsEMaLqw7OUC\u0026amp;pg\u003dPA150\u0026amp;dq\u003d%22bushwalking%22+-intitle:%22bushwalking%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dPFIbT7uOJs-QiQesh73ZCw\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22bushwalking%22%20-intitle%3A%22bushwalking%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 150\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Kakadu is excellent but tough \u0027\u0027bushwalking\u0027\u0027 country\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Holly Smith, \u0027Sydney \u0026amp; New South Wales\u0027, excellent+bushwalking%22+-intitle:%22bushwalking%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dbA8cT5i2EaihiAfN0pTzCw\u0026amp;redir_esc\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"excellent%20bushwalking%22%20-intitle%3A%22bushwalking%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse unnumbered page\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"This significant chunk of wilderness, just 7.2 mi/12 km north of Sydney, provides excellent \u0027\u0027bushwalking\u0027\u0027 within a few minutes of the Manly Beach coastline\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Marc Llewellyn, Lee Atkinson, Ron Crittall, Lee Mylne, \u0027Frommer′s Australia\u0027, [http://books.google.com.au/books?id\u003dx8kDKztbFAYC\u0026amp;pg\u003dPA674\u0026amp;dq\u003d%22bushwalking%22+-intitle:%22bushwalking%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d4wocT_u0COO7iAeoz6H1Cw\u0026amp;redir_esc\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22bushwalking%22%20-intitle%3A%22bushwalking%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 675\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"Phillip Island also offers nice beaches, good \u0027\u0027bushwalking\u0027\u0027, fishing, and Seal Rocks\", \"priority\":16}]}, \"synonyms\":{}}");

	add("business", "{\"term\":\"business\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) \u0027busines\u0027 \u0027bisynes\u0027 from Old english (ca. 450-1100) {{m|ang|bisiġnes||business, busyness}}, equivalent to {{suffix|busy|ness|lang\u003den}}. Compare also {{l/en|busyness}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A specific commercial enterprise or establishment\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/finance-and-economics/21579860-g8-pledges-tackle-three-ts-t-time T passage\u003dThe ability to shift profits to low-tax countries by locating intellectual property in them, which is then licensed to related \u0027\u0027businesses\u0027\u0027 in high-tax countries, is often assumed to be the preserve of high-tech companies\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A person\u0027s occupation, work, or trade\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Commercial, industrial, or professional activity\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The volume or amount of commercial trade\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"passage\u003dIn America alone, people spent $170 billion on “direct marketing”—junk mail of both the physical and electronic varieties—last year. Yet of those who received unsolicited adverts through the post, only 3% bought anything as a result. If the bumf arrived electronically, the take-up rate was 0.1%. And for online adverts the “conversion” into sales was a minuscule 0.01%. That means about $165 billion was spent not on drumming up \u0027\u0027business\u0027\u0027, but on annoying people, creating landfill and cluttering spam filters\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"One\u0027s dealings; patronage\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Private commercial interests taken collectively\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/business/21583242-businesspeople-have-become-too-influential-government-cronies-and-capitols Cronies and passage\u003dPolicing the relationship between government and \u0027\u0027business\u0027\u0027 in a free society is difficult. Businesspeople have every right to lobby governments, and civil servants to take jobs in the private sector\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The management of commercial enterprises, or the study of such management\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A particular situation or activity\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"An objective or a matter needing to be deal dealt with\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Wikisource\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Something involving one personally\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"Matters that come before a body for deliberation or action\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"business Business class, the class of seating provided by airlines between first class and coach\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"Action carried out with a prop or piece of clothing, usually away from the focus of the scene\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"The collective noun for a group of ferrets\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"Something very good; top quality. (possibly from \u0026quot;the bee\u0027s knees\u0026quot\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"Excrement, particularly that of a non-human animal\", \"priority\":20}]}, \"synonyms\":{}}");

